besties.factory('Chatserv',function(){
	var findGrpfun = function($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http){
		var data = {
			"uID":localStorage.userId,
			"uContact":localStorage.userContact,
			"friendID":$scope.uid,
			"friendContact":$scope.ucontact
		};
		//console.info("post data "+JSON.stringify(data));
		$http.post(localStorage.myURL+"/mobile/my/chats/group",data)
		.success(function(res){
			//console.log(JSON.stringify(res));
			var resp = JSON.parse(JSON.stringify(res));
			if(resp.status == "csuccess"){
				console.log(resp.group+" "+resp.message+" ");
				$scope.chatchannel = resp.group;
				localStorage.chatchannel = $scope.chatchannel;
				console.log("grpcs:"+$scope.chatchannel);
				$scope.nochat = false;
				receiveMessage($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
				$timeout(function(){$ionicLoading.hide();},1000);
				$timeout(function(){$scope.nochat = true;},10000);
			}else if(resp.status == "success"){
				console.log(resp.group+" "+resp.message+" "+resp.groupname);
				$scope.chatchannel = resp.group;
				localStorage.chatchannel = $scope.chatchannel;
				console.log("grps:"+$scope.chatchannel);
				$timeout(function(){$ionicLoading.hide();},1000);
				receiveMessage($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
			}else{
				console.log("server not proceessed the request");
				$timeout(function(){$ionicLoading.hide();},1000);
			}
		})
		.error(function(err){
			console.log("server failed to proceessed the request");
				$timeout(function(){$ionicLoading.hide();},1000);
		});
	};
		var i = 1;
	var receiveMessage = function($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http){
		//console.log("call "+(i++));
		var data = {
			"chatID":localStorage.secret,
			"uID":localStorage.userId,
			"uContact":localStorage.userContact,
			"chatuID":localStorage.chatWithID,
			"chatuContact":localStorage.chatWith,
			"grpToken":localStorage.chatchannel,
			"active":'1'
		}
		//console.log("send at:"+JSON.stringify(data));
		$http.post(localStorage.myURL+"/mobile/my/chats/group/messages",data)
		.success(function(res){
			var resp = JSON.parse(JSON.stringify(res));
			if(resp.status == "success"){
				//$scope.chat.text = '';
				$scope.messages = JSON.parse(JSON.stringify(resp.data));
				$ionicScrollDelegate.scrollBottom();
				//console.log("resp:"+JSON.stringify(res));
				//console.log(resp.group+" "+resp.message+" ");
			}else{
				//$scope.chat.text = '';
				//console.log("server not proceessed the request");
			}
		})
		.error(function(err){
			//$scope.chat.text = '';
			console.log("server failed to proceessed the request");
		});
		setTimeout(function(){receiveMessage($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);},15000);
	}
	var sendMessage = function($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http){
		var data = {
			"chatID":localStorage.secret,
			"uID":localStorage.userId,
			"uContact":localStorage.userContact,
			"chatuID":$scope.uid,
			"chatuContact":$scope.ucontact,
			"message":$scope.chat.text,
			"mediaFile":"",
			"mediaType":"",
			"sendbyID":localStorage.userId,
			"grpToken":$scope.chatchannel,
			"userTime":moment().format('dddd, MMMM Do YYYY, h:mm:ss a'),
			"sendAt":moment().format('YYYY-MM-DD'),
			"sendAtAMPM":moment().format('A'),
			"active":1
		}
		//console.log("send at:"+JSON.stringify(data));
		$http.post(localStorage.myURL+"/mobile/my/chats/group/send",data)
		.success(function(res){
			//console.log(JSON.stringify(res));
			var resp = JSON.parse(JSON.stringify(res));
			if(resp.status == "success"){
				$scope.chat.text = '';
				receiveMessage($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
				//console.log(resp.group+" "+resp.message+" ");
			}else{
				$scope.chat.text = '';
				console.log("server not proceessed the request");
			}
		})
		.error(function(err){
			$scope.chat.text = '';
			console.log("server failed to proceessed the request");
		});
	}
	var deleteMessage = function(m,$scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http){
		var data = {
			"id":m.id,
			"uID":localStorage.userId,
			"uContact":localStorage.userContact,
			"chatuID":$scope.uid,
			"chatuContact":$scope.ucontact,
			"grpToken":$scope.chatchannel
		}
		//console.log("send at:"+JSON.stringify(data));
		$http.post(localStorage.myURL+"/mobile/my/chats/group/messages/delete",data)
		.success(function(res){
			var resp = JSON.parse(JSON.stringify(res));
			if(resp.status == "success"){
				//$scope.chat.text = '';
				//console.log(JSON.stringify(res));
				receiveMessage($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
				//console.log(resp.group+" "+resp.message+" ");
			}else{
				console.log("server not proceessed the request");
			}
		})
		.error(function(err){
			console.log("server failed to proceessed the request");
		});
	}
	var sendImageInChatFun = function($ionicLoading,$http,$cordovaToast,$scope,$timeout,$ionicPopup,$ionicScrollDelegate){
		$scope.sendpics = $scope.imagebase64;
		var imagebase = $scope.sendpics;
		var spl = imagebase.split(";");
		var splans = spl[0];
		var spl2 = splans.split(":");
		var spl2ans = spl2[1];
		$ionicLoading.show({
            template:"<div class='uil-ball-css' style='-webkit-transform:scale(0.6)'><div></div></div>",/*templates/css/loader.html*/
            cssClass:"ionicLoadingCss1",
            animation: 'fade-in',
            showBackdrop: false,
        });
        var data = {
            "chatID":localStorage.secret,
			"uID":localStorage.userId,
			"uContact":localStorage.userContact,
			"chatuID":$scope.uid,
			"chatuContact":$scope.ucontact,
			"message":"",
			"mediaLink":"",
			"mediaText":$scope.sendpics,
			"mediaType":spl2ans,
			"sendbyID":localStorage.userId,
			"grpToken":$scope.chatchannel,
			"userTime":moment().format('dddd, MMMM Do YYYY, h:mm:ss a'),
			"sendAt":moment().format('YYYY-MM-DD'),
			"sendAtAMPM":moment().format('A')
        };
        //console.info(JSON.stringify(data));
        //$ionicLoading.hide();
        $http.post(localStorage.myURL+"/mobile/my/chats/group/sendpic",data)
        .success(function(res){
            $ionicLoading.hide();
            $scope.sendpics = "";
            console.log(JSON.stringify(res));
            //alert("updated "+JSON.stringify(res));
            var result = JSON.parse(JSON.stringify(res));
            if(result.status == "success"){
            	receiveMessage($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
                //alert("updated "+JSON.stringify(res));
                $cordovaToast.show("Sended!", 'long', 'center')
	                .then(function(success) {//
	                }, function (error) { //
	                });					
            }else{
            	$cordovaToast.show("Image unable send!", 'long', 'center')
	                .then(function(success) {//
	                }, function (error) {//
	                });					
               //alert("in else failed "+JSON.stringify(res));
            }
        })
        .error(function(err){
            $ionicLoading.hide();
            //alert("can not update "+JSON.stringify(err));
        });
	}
	return {
		findGrp:function($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http){
			findGrpfun($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
		},
		sendmsg:function($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http){
			sendMessage($scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
		},
		deletemsg:function(m,$scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http){
			deleteMessage(m,$scope,$timeout,$ionicLoading,$ionicPopup,$ionicScrollDelegate,$http);
		},
		sendImageInChat:function($ionicLoading,$http,$cordovaToast,$scope,$timeout,$ionicPopup,$ionicScrollDelegate){
			sendImageInChatFun($ionicLoading,$http,$cordovaToast,$scope,$timeout,$ionicPopup,$ionicScrollDelegate);
		}
	}
})
